social_posts.post_text:
While I haven’t been to as many events lately, I went to check out the first day of the Network Trade Show yesterday. I was surprised at the size of the event, the quality of the brands and activations, and the turnout was top shelf as well. 🏆 I got to see some of my industry favorites and had fun exploring all the interactive setups. Props to the Network Trade Show for putting together a top notch event that reminds me of what these industry happenings are supposed to be- giving back, supporting the industry, and having a real good time. 👌🏻
